(1, 1, '2020-09-28 17:41:19', '2020-09-28 14:41:19', '', 'Дом #1', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2020-10-01 11:55:41', '2020-10-01 08:55:41', '', 0, 'http://timberhouses/?p=1', 0, 'post', '', 1),
