(5, 1, '2020-09-29 15:56:32', '2020-09-29 12:56:32', '{\n    \"blogdescription\": {\n        \"value\": \"\\u0421\\u0442\\u0440\\u043e\\u0438\\u0442\\u0435\\u043b\\u044c\\u0441\\u0442\\u0432\\u043e \\u0434\\u043e\\u043c\\u043e\\u0432 \\u0438\\u0437 \\u0431\\u0440\\u0443\\u0441\\u0430\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-09-29 12:56:32\"\n    }\n}', '', '', 'trash', 'closed', 'closed', '', 'dead7725-1661-4e88-814c-4322096f1957', '', '', '2020-09-29 15:56:32', '2020-09-29 12:56:32', '', 0, 'http://timberhouses/?p=5', 0, 'customize_changeset', '', 0),
(6, 1, '2020-09-29 16:48:53', '2020-09-29 13:48:53', '<!-- wp:paragraph -->\n<p>Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...или так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Перейдите <a href=\"http://timberhouses/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!</p>\n<!-- /wp:paragraph -->', 'Главная страница', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-09-29 16:48:53', '2020-09-29 13:48:53', '', 2, 'http://timberhouses/?p=6', 0, 'revision', '', 0),
